import React, { useState, useEffect } from "react";
import "./Family.css";
import CategoriesNav from "../categoriesNav/categoriesNav";

const Family = () => {
  const [data, setData] = useState([]); 
  const [loading, setLoading] = useState(true); 
  const [error, setError] = useState(null);

 
  const fetchData = async () => {
    try {
      const response = await fetch("https://api.example.com/Family"); 
      if (!response.ok) {
        throw new Error("Failed to fetch data");
      }
      const result = await response.json();
      setData(result); 
    } catch (err) {
      setError(err.message); 
    } finally {
      setLoading(false); 
    }
  };

  useEffect(() => {
    fetchData(); 
  }, []);

  return (
    <div className="Family">
      <CategoriesNav/>
      <h2 className="Family-title">Available Family</h2>

      {loading && <p>Loading...</p>}
      {error && <p style={{ color: "red" }}>{error}</p>} 

      <div className="Family-container">
        {data.map((family) => (
          <div key={family.id} className="Family-card">
            <img src={family.image} alt={family.name} className="Family-image" />
            <div className="Family-content">
              <h3 className="Family-name">{family.name}</h3>
              <p className="Family-description">{family.description}</p>
              <p className="Family-price">Price: {family.price}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Family;
